import React from "react";

import styles from "../CSS/component.module.css";

export const AdminTaskRow = ({
  taskID,
  taskName,
  desc,
  period,
  waiting,
  participants,
}) => {
  return (
    <div>
      <div className={styles.outer_row}>
        <div className={styles.inner_row}>
          <p>{taskName}</p>
          <p>{desc}</p>
          <p>{period}</p>
          <p>{waiting}</p>
          <p>{participants}</p>
          <button>수정</button>
        </div>
      </div>
    </div>
  );
};
